def seed_to_array(seed):

    seed = abs(int(seed))
    arr = []
    while seed:
        arr.append(seed & 0xFFFFFFFF)
        seed >>= 32
    if not arr:
        arr = [0]
    return arr

class MT19937:
    def __init__(self, seed):
        self.N = 624
        self.M = 397
        self.MATRIX_A = 0x9908B0DF
        self.UPPER_MASK = 0x80000000
        self.LOWER_MASK = 0x7FFFFFFF

        self.mt = [0] * self.N
        self.index = self.N

        self.init_by_array(seed_to_array(seed))

    def init_by_array(self, key):
        self.mt[0] = 19650218
        for i in range(1, self.N):
            self.mt[i] = (1812433253 * (self.mt[i - 1] ^ (self.mt[i - 1] >> 30)) + i) & 0xFFFFFFFF

        i, j = 1, 0
        for _ in range(max(self.N, len(key))):
            self.mt[i] = (self.mt[i] ^ ((self.mt[i - 1] ^ (self.mt[i - 1] >> 30)) * 1664525)) + key[j] + j
            self.mt[i] &= 0xFFFFFFFF
            i += 1
            j += 1
            if i >= self.N:
                self.mt[0] = self.mt[self.N - 1]
                i = 1
            if j >= len(key):
                j = 0

        for _ in range(self.N - 1):
            self.mt[i] = (self.mt[i] ^ ((self.mt[i - 1] ^ (self.mt[i - 1] >> 30)) * 1566083941)) - i
            self.mt[i] &= 0xFFFFFFFF
            i += 1
            if i >= self.N:
                self.mt[0] = self.mt[self.N - 1]
                i = 1

        self.mt[0] = 0x80000000

    def twist(self):
        for i in range(self.N):
            y = (self.mt[i] & self.UPPER_MASK) + (self.mt[(i+1)%self.N] & self.LOWER_MASK)
            self.mt[i] = self.mt[(i + self.M) % self.N] ^ (y >> 1)
            if y & 1:
                self.mt[i] ^= self.MATRIX_A

    def extract_number(self):
        if self.index >= self.N:
            self.twist()
            self.index = 0

        y = self.mt[self.index]
        self.index += 1

        y ^= (y >> 11)
        y ^= (y << 7) & 0x9D2C5680
        y ^= (y << 15) & 0xEFC60000
        y ^= (y >> 18)
        return y & 0xFFFFFFFF

    def random(self):
        a = self.extract_number() >> 5
        b = self.extract_number() >> 6
        return (a * 67108864 + b) / 9007199254740992.0

import random

random.seed(230)
print("Builtin random:", random.random())

mt = MT19937(230)
print("Custom random: ", mt.random())